column73:
Prestación de servicios profesionales para la gestión de fomento de lectura; 
escritura y oralidad para planear; gestionar; ejecutar y evaluar acciones; 
orientadas a estimular; fomentar y fortalecer los procesos de lectura; escritura y 
oralidad en los diferentes grupos poblacionales; de acuerdo con las políticas y 
planes existentes en el ámbito local y nacional; y con lo establecido por el plan 
estratégico y plan táctico del Sistema de Bibliotecas Públicas de Medellín.

